import React from 'react';
import './FinalPay.css';
import InfoSection from './InfoSection';
import Payment from './PaymentSection';

function FinalPay() {
  return (
    <div className="final-pay">
        <InfoSection />
        <Payment />
    </div>
  );
}

export default FinalPay;
